import React from 'react';

const FieldsViewer=({label, value="#000000", handleChange, type="text"})=>{
    var value;
    if(type==="color")
    {
        handleChange();
    }
    return(
        <div>
           <label>{label}:</label>
           <input
                value={value}
                required
                type={type}
                onChange={handleChange}
                >          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
